import React, { useEffect, useState } from 'react'

const Home = () => {
   const [data , setData] =  useState([])

   useEffect(()=>{
    async function product_data(){
        const response = await fetch('https://dummyjson.com/products')
        const jSonData = await response.json()
        setData(jSonData[1])
    }
    product_data()
   } , [])
  return (
    <div>
        <h2>Home</h2>
        
    </div>
  )
}

export default Home
